//import from './logo.svg';
import './App.css';
import Header from './header';
import Home from './Home';
import { BrowserRouter, Routes,Route, Router } from 'react-router-dom';
import Checkout from './Checkout';


function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/checkout'>
            <Header />
            <Checkout />
          </Route>

          <Route path='/'>
            <Header />
            <Home />
          </Route>
        </Switch>
      </Router>

  </div>
  )
}


export default App;
